// src/api.js
const apiUrl = 'http://localhost:8080/newgame';

const getPlayer = async (name) => {
    const url = `${apiUrl}?name=${name}`;
  
    const response = await fetch(url);
    const player = await response.json();
    return player;
  };

export default getPlayer;
